import { Grid, Stack ,Box } from "@mui/material";
//import { Box } from "@mui/system";
import { Icon } from '@iconify/react';


function Selector()
{
    return(

        <Grid container direction="row" justifyContent="center" alignment="center" m={25}>
        <Stack
            direction="row"
            justifyContent="center"
            alignment="center"
            m={25}

        >
            <Box m={25} component="span" sx={{ boarder:1}}>

                    <Icon icon="bi:mic-fill" color="blue" width="200" height="200" />
            </Box>   

            <Box m={25} component="span" sx={{}}>
            <Icon icon="bi:upload" color="blue" width="200" height="200" />

            </Box>   




        </Stack>


        <Box
        sx={{
          boxShadow: 3,
          width: '8rem',
          height: '5rem',
          bgcolor: (theme) => (theme.palette.mode === 'dark' ? '#101010' : '#fff'),
          color: (theme) =>
            theme.palette.mode === 'dark' ? 'grey.300' : 'grey.800',
          p: 1,
          m: 1,
          borderRadius: 2,
          textAlign: 'center',
          fontSize: '0.875rem',
          fontWeight: '700',
        }}
      >
        boxShadow: 3
      </Box>


      <Box
        sx={{
          boxShadow: 3,
          width: '8rem',
          height: '5rem',
          bgcolor: (theme) => (theme.palette.mode === 'dark' ? '#101010' : '#fff'),
          color: (theme) =>
            theme.palette.mode === 'dark' ? 'grey.300' : 'grey.800',
          p: 1,
          m: 1,
          borderRadius: 2,
          textAlign: 'center',
          fontSize: '0.875rem',
          fontWeight: '700',
        }}
      >
        boxShadow: 3
      </Box>



        </Grid>
    );
}

export default Selector;
